  {
    id: "3",
    image: require("../assets/list/cosmetic.png"),
    name: "COSMETIC",
  },

  {
    id: "4",
    image: require("../assets/list/skincare.png"),
    name: "SKINCARE",
  },
  {
    id: "5",
    image: require("../assets/list/music.png"),
    name: "MUSIC",
  },
  {
    id: "6",
    image: require("../assets/list/watch.png"),
    name: "WATCHES",
  },
];

export { list };
